import styled from 'styled-components';

const iucnDic = {
    "A_1": "Extinct",
    "A_2": "Extinct in the wild",
    "A_3": "Creitically endangered",
    "A_4": "Endangered",
    "A_5": "Vulnerable",
    "A_6": "Near threatened",
    "A_7": "Least concern"
}

const ImgStyle = styled.div`
    height: 100px;
`;


const NavCat = (props) => {
    const cat = props.cat
    return (
        <>
            <ImgStyle>
                <img style={{ height: "100%" }} src={cat.image} alt={cat.name} />
            </ImgStyle>
            <p>{cat.name}</p>
            <p>{iucnDic[cat.iucnStatus]}</p>
        </>
    )
}

export default NavCat
